import { useState } from "react";

const Login = () => {
    
    const [email,setEmail] = useState('')
    const [password,setPassword] = useState('')

    return ( 
        <div className="container-lg">
            <div className="row justify-content-center align-items-center">
                <div className="col-10 col-log-6">
                    <form className="mt-5">
                    <label className="form-label mt-3 lead">Email </label>
                        <div className="input-group">
                            <span className="input-group-text"><i class="bi bi-envelope"></i></span>
                            <input type="email" 
                        className="form-control" 
                        placeholder="e.g.test@gmail.com"
                        required
                        value={email}
                        onChange={(e)=>setEmail(e.target.value)}
                        />
                        </div>

                        <label className="form-label mt-3 lead">Password </label>
                        <div className="input-group">
                            <span className="input-group-text"><i class="bi bi-lock"></i></span>
                            <input type="password" 
                                className="form-control" 
                                placeholder="e.g. #242231dajd@"
                                required
                                value={password}
                                onChange={(e)=>setPassword(e.target.value)}
                            />
                        </div>

                        <div className="text-center my-3">
                            <button className="btn btn-lg btn-primary ">submit</button>
                        </div>

                    </form>
                </div>
            </div>
        </div>
     );
}
 
export default Login;
